//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MyContract{
    uint public myUint  = 1;
    uint256 public myUint256  = 1;   // uint is shorthand of uint256.
    string public myString = "Hello world!";
     
    struct Mystruct{
        uint256 myUint;
        string myString;
    }

    Mystruct public mystruct = Mystruct(1,"Wow");
    // this is state variable
    // this variable value can store inside blockchain
    // we can use this variable inside any function or contract

    function getValue() public pure returns(uint){
        uint value = 1;
        return value;

        // local variable can only declare and use inside function
        // local variable scope is only for function
    }


    // variables can store values 
}

